lay_url\":\"dgsa.de/fachgruppen/ne…\",\"status\":200,\"title\":\"netzwerkAGsozialearbeit\",\"description\":\"Das Netzwerk wurde im Jahre 2018 im Rahmen der ersten Vorkonferenz der DGSA für Promovierende und Promotionsinteressierte der Sozialen Arbeit in Hamburg gegründet. Seither sind vielfältige Aktivitäten zur Sichtbarmachung, Vernetzung und Diskussion des wissenschaftlichen „Nachwuchses“ bzw. der non-professoralen Wissenschaft in der Soziale Arbeit entstanden. Unser Anliegen war und ist es, einen institutionell abgesicherten und anerkannten Raum zu schaffen, in dem sich die Mitglieder über gemeinsame Anliegen\",\"unwound_url\":\"https://www.dgsa.de/fachgruppen/netzwerkagsozialearbeit/\"}],\"hashtags\":[{\"start\":27,\"end\":37,\"tag\":\"Mittelbau\"},{\"start\":64,\"end\":77,\"tag\":\"Wissenschaft\"},{\"start\":98,\"end\":112,\"tag\":\"SozialeArbeit\"},{\"start\":203,\"end\":215,\"tag\":\"IchbinHanna\"}],\"mentions\":[{\"start\":194,\"end\":202,\"username\":\"dieDGSA\"}]},\"geo\":{\"place_id\":\"5bcd72da50f0ee77\"},\"possibly_sensitive\":false,\"id\":\"1403247807386034176\",\"author_id\":\"1068544566385623041\",\"conversation_id\":\"1403247807386034176\",\"text\":\"Die aktuelle Situation des #Mittelbau und der non-professoralen #Wissenschaft ist auch im Bereich #SozialeArbeit schlecht. Wer sich organisieren will, kann das bspw. in der neuen Fachgruppe der @dieDGSA #IchbinHanna\\nhttps://t.co/vvQmvUHPCi\",\"source\":\"Twitter for Android\",\"created_at\":\"2021-06-11T07:08:43.000Z\",\"lang\":\"de\"},{\"public_metrics\":{\"retweet_count\":0,\"reply_count\":0,\"like_count\":7,\"quote_count\":0},\"entities\":{\"urls\":[{\"start\":280,\"end\":303,\"url\":\"https://t.co/hnCDy7tCrp\",\"expanded_url\":\"https://twitter.com/FabianFritz9/status/1403246756033347591/photo/1\",\"display_url\":\"pic.twitter.com/hnCDy7tCrp\"}],\"hashtags\":[{\"start\":30,\"end\":41,\"tag\":\"Befristung\"},{\"start\":267,\"end\":279,\"tag\":\"IchBinHanna\"}]},\"geo\":{\"place_id\":\"5bcd72da50f0e