cription\":\"The \\uD83C\\uDDE9\\uD83C\\uDDEA\\uD83C\\uDDE6\\uD83C\\uDDF1 Maestro of LoFi!\",\"created_at\":\"2018-03-26T15:46:26.000Z\",\"url\":\"https://t.co/XLvJ1DelqF\",\"pinned_tweet_id\":\"1403622659313868800\",\"protected\":false,\"public_metrics\":{\"followers_count\":390,\"following_count\":700,\"tweet_count\":21384,\"listed_count\":0},\"name\":\"LofiMat\",\"entities\":{\"url\":{\"urls\":[{\"start\":0,\"end\":23,\"url\":\"https://t.co/XLvJ1DelqF\",\"expanded_url\":\"http://soundcloud.com/lofimat\",\"display_url\":\"soundcloud.com/lofimat\"}]}},\"id\":\"978297132053655552\",\"location\":\"Berlin, Deutschland\"}],\"tweets\":[{\"public_metrics\":{\"retweet_count\":8,\"reply_count\":3,\"like_count\":56,\"quote_count\":0},\"geo\":{\"place_id\":\"1876307c1fe06ccd\"},\"possibly_sensitive\":false,\"id\":\"1403800980542607360\",\"author_id\":\"244929755\",\"conversation_id\":\"1403800980542607360\",\"text\":\"Was an der #IchbinHanna Diskussion besonders interessant ist: In keiner anderen Branche heißt es, dass eine Generation Stellen „verstopft“ und deshalb nach 12 Jahren ein Glücksspiel mit Lebensbruch Risiko stattfinden muss. Auch in der internationalen Wissenschaft ist das nicht so\",\"source\":\"Twitter for iPhone\",\"created_at\":\"2021-06-12T19:46:49.000Z\",\"lang\":\"de\",\"entities\":{\"hashtags\":[{\"start\":11,\"end\":23,\"tag\":\"IchbinHanna\"}]}},{\"public_metrics\":{\"retweet_count\":6,\"reply_count\":0,\"like_count\":23,\"quote_count\":0},\"entities\":{\"urls\":[{\"start\":199,\"end\":222,\"url\":\"https://t.co/xOTTX4neXC\",\"expanded_url\":\"https://twitter.com/tspwissenschaft/status/1403357508798922760\",\"display_url\":\"twitter.com/tspwissenschaf…\"}],\"hashtags\":[{\"start\":0,\"end\":12,\"tag\":\"IchbinHanna\"},{\"start\":31,\"end\":44,\"tag\":\"Wissenschaft\"},{\"start\":50,\"end\":63,\"tag\":\"TraumjobWiss\"},{\"start\":77,\"end\":98,\"tag\":\"Wissenschaftlerinnen\"},{\"start\":103,\"end\":119,\"tag\":\"Wissenschaftler\"},{\"start\":149,\"end\":158,\"tag\":\"Unionize\"},{\"start\":170,\"end\":183,\"tag\":\"Dauerstellen\"},{\"start\":184,\"end\":198,\"tag\":\"FristIstFrust\"}],\"mentions\":[{\"start\":160,\"end\":169,\"username\":\"gew_bund\"}]},\"geo\":{\"place_id\":\"5bcd72da50f0ee77\"},\"possibly_sensitive\":false,\"id\":\"1403394310846955527\",\"author_id\":\"284725708\",\"conversation_id\":\"1403394310846955527\",\"text\":\"#IchbinHanna  - oder warum die #Wissenschaft kein #TraumjobWiss ist ind auch #Wissenschaftlerinnen und #Wissenschaftler eine starke Stimme brauchen. #Unionize! @gew_bund #Dauerstellen #FristIstFrust https://t.co/xOTTX4neXC\",\"source\":\"Twitter for iPhone\",\"created_at\":\"2021-06-11T16:50:52.000Z\",\"lang\":\"de\",\"referenced_tweets\":[{\"type\":\"quoted\",\"id\":\"1403357508798922760\"}]},{\"public_metrics\":{\"retweet_count\":39,\"reply_count\":9,\"like_count\":516,\"quote_count\":1},\"geo\":{\"place_id\":\"f09a7d4814d9f5fa\"},\"possibly_sensitive\":false,\"id\":\"1403043258431901703\",\"author_id\":\"747879943783260162\",\"conversation_id\":\"1403043258431901703\",\"text\":\"Ich bin Irmtraud, 41 Jahre, in der Endphase der Habilitation. Meine Stelle als akademische Rätin ist super, aber halt befristet und wer weiß, (ob) was danach kommt. Bin Erstakademikerin und alleine mit Kind, Existenzängste bleiben tbh nicht aus. #IchbinHanna\",\"source\":\"Twitter for iPhone\",\"created_at\":\"2021-06-10T17:35:54.000Z\",\"lang\":\"de\",\"entities\":{\"hashtags\":[{\"start\":246,\"end\":258,\"tag\":\"IchbinHanna\"}]}},{\"public_metrics\":{\"retweet_count\":37,\"reply_count\":4,\"like_count\":61,\"quote_count\":2},\"entities\":{\"urls\":[{\"start\":164,\"end\":187,\"url\":\"https://t.co/pPeXz2ZM32\",\"expanded_url\":\"https://www.tagesspiegel.de/wissen/aufschrei-des-wissenschaftlichen-nachwuchses-ichbinhanna-trendet-auf-twitter/27278532.html\",\"display_url\":\"tagesspiegel.de/wissen/aufschr…\"}],\"hashtags\":[{\"start\":0,\"end\":12,\"tag\":\"IchbinHanna\"},{\"start\":109,\"end\":125,\"tag\":\"AcademicTwitter\"},{\"start\":126,\"end\":142,\"tag\":\"AcademicChatter\"},{\"start\":143,\"end\":151,\"tag\":\"ecrchat\"}],\"mentions\":[{\"start\":75,\"end\":86,\"username\":\"EvaMurasov\"},{\"start\":95,\"end\":108,\"username\":\"Tagesspiegel\"},{\"start\":152,\"end\":162,\"username\":\"BMBF_Bund\"}]},\"possibly_sensitive\":false,\"id\":\"1403357508798922760\",\"author_id\":\"1130552807549997056\",\"conversation_id\":\"1403357508798922760\",\"text\":\"#IchbinHanna - wie alles begann und was dahintersteckt, eine Recherche von @EvaMurasov für den @Tagesspiegel #AcademicTwitter #AcademicChatter #ecrchat @BMBF_Bund \\nhttps://t.co/pPeXz2ZM32\",\"source\":\"Twitter Web App\",\"created_at\":\"2021-06-11T14:24:37.000Z\",\"lang\":\"de\"},{\"public_metrics\":{\"retweet_count\":47,\"reply_count\":5,\"like_count\":330,\"quote_count\":0},\"entities\":{\"urls\":[{\"start\":263,\"end\":286,\"url\":\"https://t.co/IYt0wMJyPE\",\"expanded_url\":\"https://twitter.com/DrKEichhorn/status/1402595115043115008\",\"display_url\":\"twitter.com/DrKEichhorn/st…\"}],\"hashtags\":[{\"start\":250,\"end\":262,\"tag\":\"IchbinHanna\"}]},\"geo\":{\"place_id\":\"3078869807f9dd36\"},\"possibly_sensitive\":false,\"id\":\"1402939532849319939\",\"author_id\":\"47919307\",\"conversation_id\":\"1402939532849319939\",\"text\":\"Dass befristete Beschäftigung \\\"das System frisch halt\\\" wird ausschließlich von Menschen argumentiert, die in diesem System auf beamteten Dauerstellen sitzen. Wenn das Argument stimmen würde, wären das die am wenigsten innovativen Menschen im System. #IchbinHanna https://t.co/IYt0wMJyPE\",\"source\":\"Twitter for Android\",\"created_at\":\"2021-06-10T10:43:44.000Z\",\"lang\":\"de\",\"referenced_tweets\":[{\"type\":\"quoted\",\"id\":\"1402595115043115008\"}]},{\"public_metrics\":{\"retweet_count\":15,\"reply_count\":5,\"like_count\":92,\"quote_count\":1},\"geo\":{\"place_id\":\"3078869807f9dd36\"},\"possibly_sensitive\":false,\"id\":\"1403085083419021312\",\"author_id\":\"47919307\",\"conversation_id\":\"1403085083419021312\",\"text\":\"Wir diskutierenn ein neues Hochschulgesetz in Berlin. Zentral ist für mich die Schaffung einer unbefristeten wissenschaftlichen Personalkategorie im angestellten Mittelbau - einsetzend nach der Promotion. Wie die heißt, ist egal: Lecturer, Dozent, Assistent Prof. #IchbinHanna\",\"source\":\"Twitter for Android\",\"created_at\":\"2021-06-10T20:22:06.000Z\",\"lang\":\"de\",\"entities\":{\"hashtags\":[{\"start\":264,\"end\":276,\"tag\":\"IchbinHanna\"}]}},{\"public_metrics\":{\"retweet_count\":11,\"reply_count\":32,\"like_count\":171,\"quote_count\":3},\"geo\":{\"place_id\":\"9af0e1c3b9def9f4\"},\"possibly_sensitive\":false,\"id\":\"1403060492319526912\",\"author_id\":\"1183781328\",\"conversation_id\":\"1403060492319526912\",\"text\":\"Wer ist denn von #IchbinHanna alles in der Gewerkschaft?\",\"source\":\"Twitter for iPhone\",\"created_at\":\"2021-06-10T18:44:23.000Z\",\"lang\":\"de\",\"entities\":{\"hashtags\":[{\"start\":17,\"end\":29,\"tag\":\"IchbinHanna\"}]}},{\"public_metrics\":{\"retweet_count\":3,\"reply_count\":0,\"like_count\":6,\"quote_count\":0},\"entities\":{\"urls\":[{\"start\":216,\"end\":239,\"url\":\"https://t.co/vvQmvUHPCi\",\"expanded_url\":\"https://www.dgsa.de/fachgruppen/netzwerkagsozialearbeit/\",\"display_url\":\"dgsa.de/fachgruppen/ne…\",\"status\":200,\"title\":\"netzwerkAGsozialearbeit\",\"description\":\"Das Netzwerk wurde im Jahre 2018 im Rahmen der ersten Vorkonferenz der DGSA für Promovierende und Promotionsinteressierte der Sozialen Arbeit in Hamburg gegründet. Seither sind vielfältige Aktivitäten zur Sichtbarmachung, Vernetzung und Diskussion des wissenschaftlichen „Nachwuchses“ bzw. der non-professoralen Wissenschaft in der Soziale Arbeit entstanden. Unser Anliegen war und ist es, einen institutionell abgesicherten und anerkannten Raum zu schaffen, in dem sich die Mitglieder über gemeinsame Anliegen\",\"unwound_url\":\"https://www.dgsa.de/fachgruppen/netzwerkagsozialearbeit/\"}],\"hashtags\":[{\"start\":27,\"end\":37,\"tag\":\"Mittelbau\"},{\"start\":64,\"end\":77,\"tag\":\"Wissenschaft\"},{\"start\":98,\"end\":112,\"tag\":\"SozialeArbeit\"},{\"start\":203,\"end\":215,\"tag\":\"IchbinHanna\"}],\"mentions\":[{\"start\":194,\"end\":202,\"username\":\"dieDGSA\"}]},\"geo\":{\"place_id\":\"5bcd72da50f0ee77\"},\"possibly_sensitive\":false,\"id\":\"1403247807386034176\",\"author_id\":\"1068544566385623041\",\"conversation_id\":\"1403247807386034176\",\"text\":\"Die aktuelle Situation des #Mittelbau und der non-professoralen #Wissenschaft ist auch im Bereich #SozialeArbeit schlecht. Wer sich organisieren will, kann das bspw. in der neuen Fachgruppe der @dieDGSA #IchbinHanna\\nhttps://t.co/vvQmvUHPCi\",\"source\":\"Twitter for Android\",\"created_at\":\"2021-06-11T07:08:43.000Z\",\"lang\":\"de\"},{\"public_metrics\":{\"retweet_count\":0,\"reply_count\":1,\"like_count\":2,\"quote_count\":0},\"geo\":{\"place_id\":\"3078869807f9dd36\"},\"possibly_sensitive\":false,\"in_reply_to_user_id\":\"301084616\",\"id\":\"1403196903794294784\",\"author_id\":\"1238776140094996481\",\"conversation_id\":\"1402982550675488784\",\"text\":\"@frkirsche #Satire?\",\"source\":\"Twitter for Android\",\"created_at\":\"2021-06-11T03:46:26.000Z\",\"lang\":\"und\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1402982550675488784\"}],\"entities\":{\"hashtags\":[{\"start\":11,\"end\":18,\"tag\":\"Satire\"}],\"mentions\":[{\"start\":0,\"end\":10,\"username\":\"frkirsche\"}]}},{\"public_metrics\":{\"retweet_count\":79,\"reply_count\":36,\"like_count\":308,\"quote_count\":6},\"entities\":{\"urls\":[{\"start\":275,\"end\":298,\"url\":\"https://t.co/BtiHvqQJxH\",\"expanded_url\":\"https://twitter.com/Ruebenhorst/status/1403099315040624643/photo/1\",\"display_url\":\"pic.twitter.com/BtiHvqQJxH\"},{\"start\":275,\"end\":298,\"url\":\"https://t.co/BtiHvqQJxH\",\"expanded_url\":\"https://twitter.com/Ruebenhorst/status/1403099315040624643/photo/1\",\"display_url\":