\"}],\"entities\":{\"hashtags\":[{\"start\":178,\"end\":190,\"tag\":\"IchbinHanna\"}]}},{\"public_metrics\":{\"retweet_count\":0,\"reply_count\":1,\"like_count\":0,\"quote_count\":0},\"possibly_sensitive\":false,\"in_reply_to_user_id\":\"2854402348\",\"id\":\"1403277069136629760\",\"author_id\":\"1224720760440262659\",\"conversation_id\":\"1402940849047146501\",\"text\":\"@FranconianExile @JungesStefanie @materockt Das gilt nur für \\\"wissenschaftliche Karrieren\\\" fernab der Privatwirtschaft. Erinnert mich an \\\"Ghostbusters\\\" - \\\"Die erwarten Resultate!\\\"\\n\\nUnd mit der Herkunft hat das schon rein gar nichts zu tun, dieser Mangel an \\\"Pöstchen\\\".\",\"source\":\"Twitter Web App\",\"created_at\":\"2021-06-11T09:04:59.000Z\",\"lang\":\"de\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1403214320515813381\"}],\"entities\":{\"mentions\":[{\"start\":0,\"end\":16,\"username\":\"FranconianExile\"},{\"start\":17,\"end\":32,\"username\":\"JungesStefanie\"},{\"start\":33,\"end\":43,\"username\":\"materockt\"}]}},{\"public_metrics\":{\"retweet_count\":493,\"reply_count\":42,\"like_count\":3462,\"quote_count\":18},\"possibly_sensitive\":false,\"id\":\"1403081714520428546\",\"author_id\":\"2316172198\",\"conversation_id\":\"1403081714520428546\",\"text\":\"Unter #IchbinHanna teilen gerade viele Wissenschaftler:innen, was die Befristungen in der Wissenschaft mit ihnen &amp; ihrem Leben machen. Es ist Ziet, endlich die Arbeitsbedingungen für Wissenschaftler:innen zu verbessern. Wie wichtig ihre Arbeit ist, zeigt nicht nur die Pandemie.\",\"source\":\"Twitter for Android\",\"created_at\":\"2021-06-10T20:08:43.000Z\",\"lang\":\"de\",\"entities\":{\"hashtags\":[{\"start\":6,\"end\":18,\"tag\":\"IchbinHanna\"}]}},{\"public_metrics\":{\"retweet_count\":0,\"reply_count\":1,\"like_count\":0,\"quote_count\":0},\"possibly_sensitive\":false,\"in_reply_to_user_id\":\"323418582\",\"id\":\"1403233658102820866\",\"author_id\":\"144780821\",\"conversation_id\":\"14030