rganisieren will, kann das bspw. in der neuen Fachgruppe der @dieDGSA #IchbinHanna\\nhttps://t.co/vvQmvUHPCi\",\"source\":\"Twitter for Android\",\"created_at\":\"2021-06-11T07:08:43.000Z\",\"lang\":\"de\"},{\"public_metrics\":{\"retweet_count\":33,\"reply_count\":2,\"like_count\":107,\"quote_count\":4},\"possibly_sensitive\":false,\"id\":\"1403006611199778816\",\"author_id\":\"280507159\",\"conversation_id\":\"1403006611199778816\",\"text\":\"With #IchBinHanna German academics share experiences of working under precarious conditions and then being forced out BY LAW after a fixed number of years if they don't get tenure. the wicked idea of #acertaindegreeofflexibility proclaims these drop-outs would enable innovation.\",\"source\":\"Twitter Web App\",\"created_at\":\"2021-06-10T15:10:17.000Z\",\"lang\":\"en\",\"entities\":{\"hashtags\":[{\"start\":5,\"end\":17,\"tag\":\"IchBinHanna\"},{\"start\":200,\"end\":228,\"tag\":\"acertaindegreeofflexibility\"}]}},{\"public_metrics\":{\"retweet_count\":3,\"reply_count\":0,\"like_count\":11,\"quote_count\":0},\"entities\":{\"urls\":[{\"start\":100,\"end\":123,\"url\":\"https://t.co/RE45nz7H4o\",\"expanded_url\":\"https://twitter.com/DrKEichhorn/status/1402595115043115008\",\"display_url\":\"twitter.com/DrKEichhorn/st…\"}],\"hashtags\":[{\"start\":46,\"end\":58,\"tag\":\"ichbinhanna\"}]},\"geo\":{\"place_id\":\"9af0e1c3b9def9f4\"},\"possibly_sensitive\":false,\"id\":\"1403219786700623873\",\"author_id\":\"1183781328\",\"conversation_id\":\"1403219786700623873\",\"text\":\"GuMo! Wenn ihr wissen wollt wieso der Hashtag #ichbinhanna heißt, könnt ihr euch das Video ansehen. https://t.co/RE45nz7H4o\",\"source\":\"Twitter for iPhone\",\"created_at\":\"2021-06-11T05:17:22.000Z\",\"lang\":\"de\",\"referenced_tweets\":[{\"type\":\"quoted\",\"id\":\"1402595115043115008\"}]},{\"public_metrics\":{\"retweet_count\":188,\"reply_count\":91,\"like_count\":842,\"quote_count\":155},\"entities\":{\"urls\":[{\"start\":112,\"end\":135,\"url\":\"https://t.co/oFpmPvbyOn\",\"expanded_url\":\"https://www.bmbf.de/de/media-video-16944.html\",\"display_url\":\"bmbf.de/de/media-video…\"}],\"hashtags\":[{\"start\":4,\"end\":15,\"tag\":\"WissZeitVG\"},{\"start\":137,\"end\":152,\"tag\":\"95vsWissZeitVG\"},{\"start\":153,\"end\":181,\"tag\":\"ACertainDegreeofFlexibility\"}],\"mentions\":[{\"start\":183,\"end\":193,\"username\":\"BMBF_Bund\"}]},\"possibly_sensitive\":false,\"id\":\"1402595115043115008\",\"author_id\":\"730098730943324162\",\"conversation_id\":\"1402595115043115008\",\"text\":\"Das #WissZeitVG als Abführmittel der Wissenschaft? Wehe, wenn eine Generation \\\"alle Stellen verstopft\\\" (01:08)! https://t.co/oFpmPvbyOn.\\n#95vsWissZeitVG #ACertainDegreeofFlexibility \\n@BMBF_Bund\",\"source\":\"Twitter Web App\",\"created_at\":\"2021-06-09T11:55:09.000Z\",\"lang\":\"de\"},{\"public_metrics\":{\"retweet_count\":1,\"reply_count\":0,\"like_count\":9,\"quote_count\":0},\"geo\":{\"place_id\":\"3e0767c2f3a12643\"},\"possibly_sensitive\":false,\"id\":\"1403053614243921927\",\"author_id\":\"1015553300811452416\",\"conversation_id\":\"1403053614243921927\",\"text\":\"Was unter #IchbinHanna zu lesen ist, zeigt, WIE dringend wir den Wechsel in der deutschen Wissenschafts- &amp; Forschungspolitik brauchen. #WissZeitVG #karliczexit\",\"source\":\"Twitter for Android\",\"created_at\":\"2021-06-10T18:17:03.000Z\",\"lang\":\"de\",\"entities\":{\"hashtags\":[{\"start\":10,\"end\":22,\"tag\":\"IchbinHanna\"},{\"start\":139,\"end\":150,\"tag\":\"WissZeitVG\"},{\"start\":151,\"end\":163,\"tag\":\"karliczexit\"}]}},{\"public_metrics\":{\"retweet_count\":2,\"reply_count\":4,\"like_count\":42,\"quote_count\":0},\"geo\":{\"place_id\":\"b309eeca0a699fc1\"},\"possibly_sensitive\":false,\"id\":\"1403093666378530819\",\"author_id\":\"764633448\",\"conversation_id\":\"1403093666378530819\",\"text\":\"Unter #IchBinHanna beschreiben Kolleg:innen des wissenschaftlichen Nachwuchses die Arbeitssituation unter Befristungsdruck an dt. Unis. Wir verlieren super ausgebildete Leute und für die Nachrückenden wird es immer unattraktiver in die Forschung zu gehen. Das ist so falsch!\",\"source\":\"Twitter for iPhone\",\"created_at\":\"2021-06-10T20:56:12.000Z\",\"lang\":\"de\",\"entities\":{\"hashtags\":[{\"start\":6,\"end\":18,\"tag\":\"IchBinHanna\"}]}},{\"public_metrics\":{\"retweet_count\":6,\"reply_count\":3,\"like_count\":24,\"quote_count\":0},\"geo\":{\"place_id\":\"37439688c6302728\"},\"possibly_sensitive\":false,\"id\":\"1403041693050589186\",\"author_id\":\"323418582\",\"conversation_id\":\"1403041693050589186\",\"text\":\"Ich habe Journalismus studiert, bei renommierten Magazinen als Redakteur gearbeitet, im Ausland als News Editor Jahre verbracht, Marketing für internationale Konzerne gemacht und jetzt werden mir für 15 Seiten 100€, bzw 10 Cent pro Wort &amp; 12€ die Stunde geboten. #IchbinHanna\",\"context_annotations\":[{\"domain\":{\"id\":\"66\",\"name\":\"Interests and Hobbies Category\",\"description\":\"A grouping of interests and hobbies entities, like Novelty Food or Destinations\"},\"entity\":{\"id\":\"857879016971186177\",\"name\":\"Marketing\",\"description\":\"Marketing\"}}],\"source\":\"Twitter for iPhone\",\"created_at\":\"2021-06-10T17:29:41.000Z\",\"lang\":\"de\",\"entities\":{\"hashtags\":[{\"start\":267,\"end\":279,\"tag\":\"IchbinHanna\"}]}},{\"public_metrics\":{\"retweet_count\":0,\"reply_count\":1,\"like_count\":7,\"quote_count\":0},\"geo\":{\"place_id\":\"3078869807f9dd36\"},\"possibly_sensitive\":false,\"id\":\"1403079602222862336\",\"author_id\":\"771444093809467397\",\"conversation_id\":\"1403079602222862336\",\"text\":\"#IchbinHanna \\nHallo, ich bin Jaana und Chemielehrerin. Ich promovierte drei Jahre lang mit einem \\\"Stipendium\\\" - nach Ablauf war ich nicht mal ALG-1-berechtigt. Als das \\\"Stipendium\\\" auslief habe ich keine Weiterfinanzierung erhalten - ich brauchte allerdings noch Zeit, ... (1/2)\",\"source\":\"Twitter for Android\",\"created_at\":\"2021-06-10T20:00:19.000Z\",\"lang\":\"de\",\"entities\":{\"hashtags\":[{\"start\":0,\"end\":12,\"tag\":\"IchbinHanna\"}]}},{\"public_metrics\":{\"retweet_count\":797,\"reply_count\":35,\"like_count\":1741,\"quote_count\":90},\"entities\":{\"urls\":[{\"start\":220,\"end\":243,\"url\":\"https://t.co/EZ8YN1X1JA\",\"expanded_url\":\"https://www.bmbf.de/de/media-video-16944.html\",\"display_url\":\"bmbf.de/de/media-video…\",\"images\":[{\"url\":\"https://pbs.twimg.com/news_img/1402590778543722496/xFefjQWc?format=jpg&name=orig\",\"width\":684,\"height\":385},{\"url\":\"https://pbs.twimg.com/news_img/1402590778543722496/xFefjQWc?format=jpg&name=150x150\",\"width\":150,\"height\":150}],\"status\":200,\"title\":\"Wozu dient das Wissenschaftszeitvertragsgesetz? - BMBF\",\"description\":\"Erklärfilm zum Wissenschaftszeitvertragsgesetz\",\"unwound_url\":\"https://www.bmbf.de/de/media-video-16944.html\"}],\"hashtags\":[{\"start\":6,\"end\":18,\"tag\":\"IchbinHanna\"},{\"start\":245,\"end\":256,\"tag\":\"WissZeitVG\"}],\"mentions\":[{\"start\":193,\"end\":203,\"username\":\"BMBF_Bund\"}]},\"possibly_sensitive\":false,\"id\":\"1402944618233217027\",\"author_id\":\"1329509098656833536\",\"conversation_id\":\"1402944618233217027\",\"text\":\"Unter #IchbinHanna teilen momentan (Nachwuchs)wissenschaftler:innen ihren prekären Status als (befristet) Angestellte in der Wissenschaft. Der Ursprung des Hashtags ist auf folgendes Video des @BMBF_Bund zurückzuführen: https://t.co/EZ8YN1X1JA\\n\\n#WissZeitVG\",\"source\":\"TweetDeck\",\"created_at\":\"2021-06-10T11:03:57.000Z\",\"lang\":\"de\"},{\"public_metrics\":{\"retweet_count\":0,\"reply_count\":2,\"like_count\":5,\"quote_count\":0},\"possibly_sensitive\":false,\"in_reply_to_user_id\":\"1065973265414479872\",\"id\":\"1403065362233630724\",\"author_id\":\"1242522982280462338\",\"conversation_id\":\"1403054343348228101\",\"text\":\"@JungesStefanie @IHnilica Danke Euch. Fühlt sich immer seltsam an, heute aber besonders.\",\"source\":\"Twitter for iPhone\",\"created_at\":\"2021-06-10T19:03:44.000Z\",\"lang\":\"de\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1403062860276715529\"}],\"entities\":{\"mentions\":[{\"start\":0,\"end\":15,\"username\":\"JungesStefanie\"},{\"start\":16,\"end\":25,\"username\":\"IHnilica\"}]}},{\"public_metrics\":{\"retweet_count\":2,\"reply_count\":0,\"like_count\":45,\"quote_count\":0},\"geo\":{\"place_id\":\"3078869807f9dd36\"},\"possibly_sensitive\":false,\"id\":\"1403054114259484675\",\"author_id\":\"725034352732704768\",\"conversation_id\":\"1403054114259484675\",\"text\":\"Ich bin Stefan. Psychologe &amp; Neurowissenschaftler, 36 und befristet beschäftigt. Damals naiv nach \\uD83C\\uDDE9\\uD83C\\uDDEA um evtl. längerfristig zu forschen, aber ein paar Jahre nach dem Dr. ist hier meist Schluss (währenddessen baut man im Heimatland am selben System). #IchbinHanna #95vsWissZeitVG\",\"source\":\"Twitter for iPhone\",\"created_at\":\"2021-06-10T18:19:02.000Z\",\"lang\":\"de\",\"entities\":{\"hashtags\":[{\"start\":254,\"end\":266,\"tag\":\"IchbinHanna\"},{\"start\":267,\"end\":282,\"tag\":\"95vsWissZeitVG\"}]}},{\"public_metrics\":{\"retweet_count\":6,\"reply_count\":0,\"like_count\":41,\"quote_count\":0},\"entities\":{\"urls\":[{\"start\":268,\"end\":291,\"url\":\"https://t.co/C9DdQLSLcM\",\"expanded_url\":\"https://twitter.com/SebastianKubon/status/1402886172158873600\",\"display_url\":\"twitter.com/SebastianKubon…\"}],\"hashtags\":[{\"start\":6,\"end\":18,\"tag\":\"IchBinHanna\"}]},\"geo\":{\"place_id\":\"37439688c6302728\"},\"possibly_sensitive\":false,\"id\":\"1403017565631389700\",\"author_id\":\"1045055329040510976\",\"conversation_id\":\"1403017565631389700\",\"text\":\"Unter #IchBinHanna lässt sich nachlesen, was im dt. Wissenschaftssystem falsch läuft. Spoiler: sehr sehr viel! Auch ich kenne als Doktorand: befristete Beschäftigung als stud. Hilfskraft, abgelehnte Stipendienbewerbungen ohne jegliches Feedback, unbezahlte Lehre etc. https://t.co/C9DdQLSLcM\",\"source\":\"Twitter for Android\",\"created_at\":\"2021-06-10T15:53:49.000Z\",\"lang\":\"de\",\"referenced_tweets\":[{\"type\":\"quoted\",\"id\":\"1402886172158873600\"}]},{\"public_metrics\":{\"retweet_count\":243,\"reply_count\":14,\"like_count\":1057,\"quote_count\":43},\"entities\":{\"urls\":[{\"start\":281,\"end\":304,\"url\":\"https://t.co/um7JiRC3kW\",\"expanded_url\":\"https://twitter.com/DrKEichhorn/status/1402595115043115008\",\"display_url\":\"twitter.com/DrKEichhorn/st…\"}],\"hashtags\":[{\"start\":195,\"end\":207,\"tag\":\"IchbinHanna\"},{\"start\":212,\"end\":227,\"tag\":\"95vsWissZeitVG\"},{\"start\":252,\"end\":280,\"tag\":\"acertaindegreeofflexibility\"}],\"mentions\":[{\"start\":4,\"end\":14,\"username\":\"BMBF_Bund\"},{\"start\":228,\"end\":238,\"username\":\"AmreiBahr\"},{\"start\":239,\"end\":251,\"username\":\"DrKEichhorn\"}]},\"possibly_sensitive\":false,\"id\":\"1402886172158873600\",\"author_id\":\"1244061463\",\"conversation_id\":\"1402886172158873600\",\"text\":\"Das @BMBF_Bund verschleißt befristete Wissenschaftler_innen und verhöhnt sie auch noch. Zur Erinnerung, dass das WissZeitVG sich gegen Menschen richtet, gebe ich dem wiss. Prekariat ein Gesicht: #IchbinHanna.    #95vsWissZeitVG @AmreiBahr @DrKEichhorn #acertaindegreeofflexibility https://t.co/um7JiRC3kW\",\"source\":\"Twitter for iPhone\",\"created_at\":\"2021-06-10T07:11:42.000Z\",\"lang\":\"de\",\"referenced_tweets\":[{\"type\":\"quoted\",\"id\":\"1402595115043115008\"}]},{\"public_metrics\":{\"retweet_count\":2,\"reply_count\":0,\"like_count\":8,\"quote_count\":0},\"entities\":{\"urls\":[{\"start\":199,\"end\":222,\"url\":\"https://t.co/5uah5ygPDQ\",\"expanded_url\":\"https://www.danisch.de/blog/2016/09/06/wenn-geisteswissenschaftler-erdbeeren-pfluecken/\",\"display_url\":\"danisch.de/blog/2016/09/0…\"},{\"start\":223,\"end\":246,\"url\":\"https://t.co/XJXqinf87f\",\"expanded_url\":\"https://twitter.com/hadmut/status/1402993002130202625\",\"display_url\":\"twitter.com/hadmut/status/…\